import Main from './Main';

class App extends React.Component{
  render() {
    return (

       <Router>
         <Switch>
           <Route path="/">
            <Top/>
           </Route>
           <Route path="/main">
            <Main/>
           </Route>     

         </Switch>
       </Router>


    );
  }
}

export default App;
